(5, 'Mana : Jesosy no fahazavana', 'FLM AMBOHIDRATRIMO\n\nIzaho tonga amin&#039;izao tontolo izao ho fahazavana, mba tsy hitoetra ao amin&#039;ny maizina izay rehetra mino Ahy.', '2023-02-14', 43, 'Jaona 12 : 46', '2023-02-13', '13:33:35'),
(6, 'TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitsangana mihazava fa tonga ny fahazavanao ary ny voninahitr&#039;i Jehovah efa miposaka aminao.&quot; Isaia 60.1\n\nNy Tafika Masina Maharitra TMM dia manasa ny Fiangonana sy ny sampana rehetra hanatrika ny fotoampivavahana fanokafana ny taom-piasana 2023 ny zoma 17 febroary @ 8ora30 eto @ FLM Ambohidratrimo.', '2023-02-14', 43, 'Ho amintsika mianakavy anie ny Tompo Jesosy.', '2023-02-13', '13:34:24'),
(3, 'Mana : Fahazavana Kristianina', 'FLM AMBOHIDRATRIMO\n\nAoka hazava eo imason&#039;ny olona toy izany koa ny fahazavanareo, mba hahitany ny asa soa ataonareo ka hankalazany ny Rainareo Izay any an-danitra.', '2023-02-13', 43, 'Matio 5 : 16', '2023-02-13', '08:28:34'),
(4, 'TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitsangana mihazava fa tonga ny fahazavanao ary ny voninahitr&#039;i Jehovah efa miposaka aminao.&quot; Isaia 60.1\n\nNy Tafika Masina Maharitra TMM dia manasa ny Fiangonana sy ny sampana rehetra hanatrika ny fotoampivavahana fanokafana ny taom-piasana 2023 ny zoma 17 febroary @ 8ora30 eto @ FLM Ambohidratrimo.', '2023-02-13', 43, 'Ho amintsika mianakavy anie ny Tompo Jesosy.', '2023-02-13', '08:58:12'),
(7, 'Mana : Fanekena', 'FLM AMBOHIDRATRIMO\n\nKoa ario ny fahalotoana sy ny lolompo rehetra, ary ekeo amin&#039;ny fahalemem-panahy ny teny nambolena, izay mahavonjy ny fanahinareo. Fa aoka ho mpankat&ograve; ny teny ianareo, fa aza mpihaino fotsiny ihany ka mamitaka ny tenanareo.', '2023-02-15', 43, 'Jakoba 1 : 21 - 22', '2023-02-13', '13:36:23'),
(8, 'TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitsangana mihazava fa tonga ny fahazavanao ary ny voninahitr&#039;i Jehovah efa miposaka aminao.&quot; Isaia 60.1\n\nNy Tafika Masina Maharitra TMM dia manasa ny Fiangonana sy ny sampana rehetra hanatrika ny fotoampivavahana fanokafana ny taom-piasana 2023 ny zoma 17 febroary @ 8ora30 eto @ FLM Ambohidratrimo.', '2023-02-15', 43, 'Ho amintsika mianakavy anie ny Tompo Jesosy.', '2023-02-13', '13:38:20'),
(9, 'Mana : Fanetre tena', 'FLM AMBOHIDRATRIMO\n\nManetre tena eo anatrehan&#039;ny Tompo, dia hanandratra anareo Izy.', '2023-02-16', 43, 'Jakoba 4 : 10', '2023-02-13', '13:41:46'),
(10, 'TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitsangana mihazava fa tonga ny fahazavanao ary ny voninahitr&#039;i Jehovah efa miposaka aminao.&quot; Isaia 60.1\n\nNy Tafika Masina Maharitra TMM dia manasa ny Fiangonana sy ny sampana rehetra hanatrika ny fotoampivavahana fanokafana ny taom-piasana 2023 ny zoma 17 febroary @ 8ora30 eto @ FLM Ambohidratrimo.', '2023-02-16', 43, 'Ho amintsika mianakavy anie ny Tompo Jesosy.', '2023-02-13', '13:42:15'),
(11, 'Mana : Faharetana', 'FLM AMBOHIDRATRIMO\n\nSambatra izay olona maharitra fakam-panahy; fa rehefa voazaha toetra izy, dia handray ny satro-boninahitra fiainana, izay nolazain&#039;ny Tompo homena izay tia Azy.', '2023-02-17', 43, 'Jakoba 1 : 12', '2023-02-13', '13:43:47'),
(12, 'Mana : Famelan-keloka', 'FLM AMBOHIDRATRIMO\n\nFa raha mamela ny fahadisoan&#039;ny olona ianareo, dia mba hamela ny anareo kosa ny Rainareo Izay any an-danitra. Fa raha tsy mamela ny fahadisoan&#039;ny olona ianareo, dia tsy hamela \nny fahadisoanareo ny Rainareo.', '2023-02-18', 43, 'Matio 6 : 14 - 15', '2023-02-13', '13:47:12'),
(13, 'Mana : Famelan-keloka', 'FLM AMBOHIDRATRIMO\n\nKoa mifaneke heloka ianareo, ary mifampivavaha, mba ho sitrana ianareo. Ny fi&agrave;san&#039;ny fivavaky ny marina dia mahery indrindra.', '2023-02-19', 43, 'Jakoba 5 : 16', '2023-02-13', '13:48:01'),
(14, 'Mana : Fiainana kristianina', 'FLM AMBOHIDRATRIMO\n\nSaino ny zavatra any ambony, fa tsy ny zavatra ety an-tany.', '2023-02-20', 44, 'Kolosiana 3 : 2', '2023-02-14', '08:02:12'),
(15, 'Mana : Faharetana', 'FLM AMBOHIDRATRIMO\n\nAry mandalo izao fiainana izao sy ny filany; fa izay manao ny sitrapon&#039;Andriamanitra no maharitra mandrakizay.', '2023-02-21', 44, 'I Jaona 2 : 17', '2023-02-14', '08:03:17'),
(16, 'Mana : Fanatonana', 'FLM AMBOHIDRATRIMO\n\nManatona an&#039;Andriamanitra, dia hanatona anareo Izy. Diovy ny tananareo, ry mpanota; ary ataovy madio ny fonareo, ry mpiroa saina. ', '2023-02-22', 44, 'Jakoba 4 : 8', '2023-02-14', '08:04:19'),
(17, 'Mana : Fanavotana ', 'FLM AMBOHIDRATRIMO\n\nIzy no ananantsika fanavotana amin&#039;ny r&agrave;ny, dia ny famelana ny fahadisoantsika, araka ny haren&#039;ny fahasoavany,', '2023-02-23', 44, 'Efesiana 1 : 7', '2023-02-14', '08:05:42'),
(18, 'Mana : Fitadiavana ny tsara', 'FLM AMBOHIDRATRIMO\n\nTandremo mba tsy hisy hamaly ratsy olona; fa miezaha mandrakariva hitady izay tsara, na amin&#039;ny namanareo na amin&#039;ny olona rehetra.', '2023-02-24', 44, 'I Tesaloniana 5 : 15', '2023-02-14', '08:06:52'),
(19, 'Mana : Fisaorana an&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\nMisaora an&#039;Andriamanitsika, ry firenena; ary asandrato ny feo fiderana Azy,', '2023-02-25', 44, 'Salamo 66 : 8', '2023-02-14', '08:07:27'),
(20, 'Mana : Fahavelomana ara-panahy', 'FLM AMBOHIDRATRIMO\n\nMahereza, ary aoka hatanjaka ny fonareo, Dia hianareo rehetra izay manantena an&#039;i Jehovah', '2023-02-27', 44, 'Salamo 31 : 24', '2023-02-14', '08:14:13'),
(22, 'Mana : Fiderana an&#039;i Jehovah', 'FLM AMBOHIDRATRIMO\n\nMifalia amin&#039;i Jehovah, ary ravoravoa hianareo olo-marina; Ary mihobia, hianareo mahitsy fo rehetra.', '2023-02-26', 44, 'Salamo 32 : 11', '2023-02-14', '08:31:30'),
(21, 'Mana : Fahatahorana an&#039;i Jehovah', 'FLM AMBOHIDRATRIMO\n\nMatahora an&#039;i Jehovah, hianareo olony masina; Fa tsy hanan-java-mahory izay matahotra Azy.', '2023-02-28', 44, 'Salama 34 : 9', '2023-02-14', '08:27:56'),
(23, 'Mana : Fiantsoana', 'FLM AMBOHIDRATRIMO\n\nAnaka, atolory ahy ny fonao, Ary aoka ny masonao ho faly mijery ny l&agrave;lako.', '2023-03-01', 44, 'Ohabolana 23 : 26', '2023-02-14', '08:36:08'),
(24, 'Mana : Tano ny hanatra', 'FLM AMBOHIDRATRIMO\n\nTano mafy ny fananarana, ka aza avela hiala; Hazony izy, fa ainao.', '2023-03-02', 44, 'Ohabolana 4 : 13', '2023-02-14', '08:39:58'),
(25, 'Mana : Lalana marina', 'FLM AMBOHIDRATRIMO\n\nAnaka, aoka tsy ho tia amin&#039;ny teny na amin&#039;ny lela isika, fa amin&#039;ny asa sy amin&#039;ny marina.', '2023-03-03', 44, 'I Jaona 3 : 18', '2023-02-14', '08:44:07'),
(26, 'Mana : Fiaretana ao aminy', 'FLM AMBOHIDRATRIMO\n\nfa araka ny iombonanareo fijaliana amin&#039;ny Kristy dia mifalia, mba hiravoravonareo indrindra amin&#039;ny fisehoan&#039;ny voninahiny koa.', '2023-03-04', 44, 'I Petera 4 : 13', '2023-02-14', '08:50:05'),
(27, 'Mana : Tenin&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ny tenin&#039;ny  Tompo maharitra mandrakizay.&quot;', '2023-03-05', 44, 'I Petera 1 : 24-25', '2023-02-14', '08:53:40'),
(28, 'RAHARAHA', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza samy mihevitra ny azy ihany, fa samy ny an&#039;ny namany koa&quot; Fil.2:4 - Alahady 19/02/2023 @ 2ora tolakandro FLM Ambohidratrimo. Fotoana hanasana manokana ny mpivady sy ny mpifamofo manampaniriana hivady. Hibanjinana ny loha-hevitra hoe &quot;Mpifankatia miara-mahatoky sy manantena an&#039;Andriamanitra&quot;. Tongava ary e! Fotoana handrenesana toriteny sy fampianarana ary fiaraha-mandinika Soratra Masina mahakasika antsika manokana,elanelanin&#039;ny lalao sy hira fiderana mahafinaritra.', '2023-02-17', 47, ' ', '2023-02-17', '08:50:05'),
(29, 'RAHARAHA', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza samy mihevitra ny azy ihany, fa samy ny an&#039;ny namany koa&quot; Fil.2:4 - Alahady 19/02/2023 @ 2ora tolakandro FLM Ambohidratrimo. Fotoana hanasana manokana ny mpivady sy ny mpifamofo manampaniriana hivady. Hibanjinana ny loha-hevitra hoe &quot;Mpifankatia miara-mahatoky sy manantena an&#039;Andriamanitra&quot;. Tongava ary e! Fotoana handrenesana toriteny sy fampianarana ary fiaraha-mandinika Soratra Masina mahakasika antsika manokana,elanelanin&#039;ny lalao sy hira fiderana mahafinaritra.', '2023-02-18', 47, ' ', '2023-02-17', '08:51:03'),
(30, 'FIFIL', 'FLM AMBOHIDRATRIMO\n\n&quot;Mivavaha, ka aza mitsahatra.&quot; I Tesaloniana 5 : 17\n\nNy FiFIL tarihin&#039;ny Ray aman-dreny Pastora no vaomieran&#039;ny vavaka isa-telo volana manainga, an-tsika hitondra am-bavaka ny vaomiera fampitaovana momba : ny chapiteau, rideau ,tapis ,sono , toeran&#039;ny chorale\n\nMandalo ny rivo-doza eto amin&#039;ny firenena. Ao amin&#039;i Jesosy Tompon-tsika irery ihany no toky sy avotra momba an&#039;izany. Mivavaha ka aza mitsahatra.', '2023-02-21', 51, 'Ny Filoha FIFIL', '2023-02-21', '11:32:57'),
(31, 'Mana : Fanomezana toky', 'FLM AMBOHIDRATRIMO\n\nNa dia mandra-pahantitrareo aza, dia tsy miova Aho, ary mandra-pahafotsy volonareo, dia Izaho ihany no hisahirana mitondra anareo. Izaho no nanao, ka Izaho ihany no hitrotro, eny, izaho no hitondra sy hanafaka.\n', '2023-03-06', 63, 'Isaia 46 : 4', '2023-03-05', '21:01:14'),
(32, 'Mana : Fahatokisana', 'FLM AMBOHIDRATRIMO\n\nMatokia an&#039;i Jehovah amin&#039;ny fonao rehetra, Fa aza miankina amin&#039;ny fahalalanao; Maneke Azy amin&#039;ny alehanao rehetra, Fa Izy handamina ny lalanao,', '2023-03-07', 63, 'Ohabolana 3 : 5 - 6', '2023-03-05', '21:02:22'),
(33, 'Mana : Fitahiana azo', 'FLM AMBOHIDRATRIMO\n\nHotahina izay olona matoky an&#039;i Jehovah, dia izay manana an&#039;i Jehovah ho tokiny.', '2023-03-08', 63, 'Jeremia 17 : 7', '2023-03-05', '21:03:33'),
(34, 'Mana : Fitiavan&#039;i Jehovah', 'FLM AMBOHIDRATRIMO\n\nFa izay tian&#039;i Jehovah no anariny, Dia tahaka ny ataon&#039;ny ray amin&#039;ny zanaka tiany.', '2023-03-09', 63, 'Ohabolana 3 : 12', '2023-03-05', '21:05:22'),
(35, 'Mana : Hafatra fahasalamana', 'FLM AMBOHIDRATRIMO\n\nNy fo ravoravo mahasalama tsara; Fa ny fanahy kivy mahamaina ny taolana.', '2023-03-10', 63, 'Ohabolana 17 : 22', '2023-03-05', '21:06:36'),
(36, 'Mana : Fivavahana', 'FLM AMBOHIDRATRIMO\n\nary mivavaha mandrakariva ao amin&#039;ny Fanahy amin&#039;ny fivavahana rehetra sy ny fangatahana, ka miambena amin&#039;izany amin&#039;ny faharetana sy ny fangatahana rehetra ho an&#039;ny olona masina rehetra,', '2023-03-11', 63, 'Efesiana 6 : 18', '2023-03-05', '21:09:24'),
(37, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\nIzay rehetra ataonareo dia ataovy amin&#039;ny fitiavana.', '2023-03-12', 63, 'I Korintiana 16 : 14', '2023-03-05', '21:11:18'),
(38, 'Mana : Andriamanitra dia fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Izao no fitiavana: tsy ny nitiavantsika an&#039;Andriamanitra fa ny nitiavany antsika, ka nirahiny ny Zanany ho avotra&#039;noho ny fahotantsika. Ry malala, raha izany no nitiavan&#039;Andriamanitra antsika, dia mba tokony hifankatia kosa isika.&quot;', '2023-03-13', 70, 'I Jaona 4 : 10 - 11', '2023-03-12', '21:30:21'),
(39, 'Mana : Fifankatiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ry malala, aoka hifankatia isika; fa avy amin&#039;Andriamanitra ny fitiavana, ary Izay rehetra tia no naterak&#039;Andriamanitra sady mahalala an&#039;Andriamanitra. Izay tsy tia dia tsy mba mahalala an&#039;Andriamanitra; fa Andriamanitra dia fitiavana.&quot;', '2023-03-14', 70, 'I Jaona 4 : 7 - 8', '2023-03-12', '21:34:14'),
(40, 'Mana : Fitiavan&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Satria malala eo imasoko ianao, eny, be voninahitra ianao sady tiako, dia olona no omeko ho solonao, ary firenena ho solon&#039;ny ainao.&quot;', '2023-03-15', 70, 'Isaia 43 : 4', '2023-03-12', '21:37:48'),
(41, 'Mana : Fanavotana', 'FLM AMBOHIDRATRIMO\n\n&quot;ary Izy no avotra noho ny fahotantsika, ary tsy noho ny antsika ihany, fa noho ny an&#039;izao tontolo izao koa.&quot;', '2023-03-16', 70, 'I Jaona 2 : 2', '2023-03-12', '21:39:40'),
(42, 'Mana : Hafatra ny Fahafahana', 'FLM AMBOHIDRATRIMO\n\n&quot;fa olona afaka ianareo, nefa aza mitondra ny fahafahanareo ho fanaronana ny ratsy, fa ho toy ny mpanompon&#039;Andriamanitra.&quot;', '2023-03-17', 70, 'I Petera 2 : 16', '2023-03-12', '21:41:08'),
(43, 'Mana : Fiankinana', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa amin&#039;izany manetre tena ambanin&#039;ny t&agrave;na-maherin&#039;Andriamanitra, mba hanandratany anareo amin&#039;ny fotoan&#039;andro; ary apetraho aminy ny fanahianareo rehetra; fa Izy no miahy anareo. \n&quot;', '2023-03-18', 70, 'I Petera 5 : 6 - 7', '2023-03-12', '21:42:35'),
(44, 'Mana : Fiarovana', 'FLM AMBOHIDRATRIMO\n\n&quot;Raha mita ny rano ianao, dia homba anao Aho; Ary raha mita ny ony ianao, dia tsy hanafotra anao izy; Raha mandeha mamaky ny afo ianao, dia tsy ho may, Ary tsy hirehitra aminao ny lelafo;\n&quot;', '2023-04-04', 72, 'Isaia 43 : 2', '2023-03-12', '21:46:27'),
(45, 'Mana : Fananarana izao tontolo izao', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary aza manaraka ny fanaon&#039;izao tontolo izao; fa miov&agrave; amin&#039;ny fanavaozana ny saina, hamantaranareo ny sitrapon&#039;Andriamanitra, dia izay tsara sady ankasitrahana no marina.&quot;', '2023-03-20', 70, 'Romana 12 : 2', '2023-03-12', '21:49:28'),
(46, 'Mana : Fananarana izao tontolo izao 2', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza tia izao tontolo izao, na izay zavatra eo amin&#039;izao tontolo izao. Raha misy olona tia izao tontolo izao dia tsy ao anatiny ny fitiavana ny Ray. Fa ny zavatra rehetra eo amin&#039;izao tontolo izao, dia ny filan&#039;ny nofo sy ny filan&#039;ny maso ary ny rehaka momba izao fiainana izao, dia tsy avy amin&#039;ny Ray, fa avy amin&#039;izao tontolo izao ihany.&quot;', '2023-03-21', 70, 'I Jaona 2 : 15 - 16', '2023-03-12', '21:52:11'),
(47, 'Mana : Ny teniny', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa na iza na iza mitandrina ny teniny, dia tanteraka ao aminy marina tokoa ny fitiavana an&#039;Andriamanitra izany no ahafantarantsika fa ao aminy isika.&quot;', '2023-03-22', 70, 'I Jaona 2 : 5', '2023-03-12', '21:55:52'),
(48, 'Mana : Ny nofo', 'FLM AMBOHIDRATRIMO\n\n&quot;Ry malala, mananatra anareo aho, satria vahiny sy mpivahiny ianareo, fadio ny filan&#039;ny nofo, fa miady amin&#039;ny fanahy ireny;&quot;', '2023-03-23', 70, 'I Petera 2 : 11', '2023-03-12', '21:57:58'),
(49, 'Mana : Sao diso lalana', 'FLM AMBOHIDRATRIMO\n\n&quot;Tandremo fandrao misy mahalasa anareo ho babony amin&#039;ny filosofia sy ny famitahana foana, araka ny fampianarana voatolotry ny razana, araka ny abidim-pianaran&#039;izao tontolo izao, fa tsy araka an&#039;i Kristy.&quot;', '2023-03-24', 70, 'Kolosiana 2 : 8', '2023-03-12', '21:59:56'),
(50, 'Mana : Fahotana', 'FLM AMBOHIDRATRIMO\n \n&quot;Fa ny helokareo no efitra mampisaraka anareo amin&#039;Andriamanitrareo, ary ny fahotanareo no mampiafina ny tavany aminareo, ka dia tsy mihaino Izy.&quot;', '2023-03-25', 70, 'Isaia 59 : 2', '2023-03-12', '22:03:23'),
(51, 'Mana : Hafatra sy Didy', 'FLM AMBOHIDRATRIMO\n\n&quot;Andriamanitra no atahory, ary ny didiny no tandremo, fa izany no tokony hataon&#039;ny olona rehetra.&quot;', '2023-04-02', 92, 'Mpitoriteny 12 : 13', '2023-03-12', '22:05:30'),
(52, 'Mana : Mitandrina ny Didy', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary izay mitandrina ny didiny no mitoetra ao aminy, ary Izy kosa ao aminy. Ary izao no ahafantarantsika fa mitoetra ao amintsika Izy, dia ny Fanahy Izay nomeny antsika.&quot;', '2023-03-27', 70, 'I Jaona 3 : 24', '2023-03-12', '22:08:02'),
(53, 'Mana : Fiainana Mandrakizay', 'FLM AMBOHIDRATRIMO \n\n&quot;Ary izao no fanambarany: Fiainana mandrakizay no omen&#039;Andriamanitra antsika, ary ao amin&#039;ny Zanany izany fiainana izany. Izay manana ny Zanaka no manana ny fiainana; izay tsy manana ny Zanak&#039;Andriamanitra no tsy manana ny fiainana.&quot;', '2023-03-28', 70, 'I Jaona 5 : 11 - 12', '2023-03-12', '22:10:11'),
(54, 'Mana : Fitiavana mandrakizay', 'FLM AMBOHIDRATRIMO\n\n&quot;Fitiavana mandrakizay no nitiavako anao, koa izany no nampaharetako famindram-po ho anao.&quot;', '2023-03-29', 70, 'Jeremia 31 : 3', '2023-03-12', '22:14:10'),
(55, 'Mana : Fanjakantsika', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ny fanjakantsika dia any an-danitra, ary avy any koa no iandrasantsika Mpamonjy, dia Jesoa Kristy Tompo,&quot;', '2023-03-30', 70, 'Filipiana 3 : 20', '2023-03-12', '22:17:38'),
(56, 'Mana : handohalehan&#039;ny lohalika', 'FLM AMBOHIDRATRIMO\n\n&quot;mba ho amin&#039;ny anaran&#039;i Jesoa no handohalehan&#039;ny lohalika rehetra, na ny any an-danitra, na ny ety an-tany, na ny any ambanin&#039;ny tany, sy haneken&#039;ny lela rehetra fa Jesoa Kristy no Tompo ho voninahitr&#039;Andriamanitra Ray.&quot;', '2023-03-31', 70, 'Filipiana 2 : 10 - 11', '2023-03-12', '22:18:46'),
(57, 'Mana : fitiavan&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary isika efa mahalala sy mino ny fitiavan&#039;Andriamanitra antsika. Andriamanitra dia fitiavana; ary izay mitoetra amin&#039;ny fitiavana no mitoetra ao amin&#039;Andriamanitra, ary Andriamanitra ao aminy. &quot;', '2023-04-01', 70, 'I Jaona 4 : 16', '2023-03-12', '22:20:39'),
(58, 'Mana : Firarian-tsoa', 'FLM AMBOHIDRATRIMO\n\n&quot;Ry malala, mangataka aho mba hambinina sy ho salama amin&#039;ny zavatra rehetra anie ianao, tahaka izay anambinana ny fanahinao ihany.&quot;', '2023-04-05', 72, 'III Jaona 2', '2023-03-12', '22:23:48'),
(59, 'Fety ny vehivavy', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa ankehitriny anaka, aza matahotra; hataoko aminao izay rehetra angatahinao; fa fantatr&#039;izay rehetra ao an-tan&agrave;nan&#039;ny fireneko fa vehivavy tsara ianao.&quot; Rota 3 : 11\n\nAm-pifaliana no iarahabana ny vehivavy rehetra tsy an-kanavaka nahatratra izao andro natokana ho anareo manokana izao.\n\nMisaotra sy mampahery ireo vehivavy mahery manefa am-panetrentena ny andraikiny, na eny an-tokantrano na eny amin&#039;ny toeram-piasana indrindra eny amin&#039;ny asa fanompoana rehetra eny, Jesosy Kristy anie hanafy hery anareo mandrakariva mba ahatanterahinareo ny adidy aman&#039;andraikitra izay nanirahana anareo.', '2023-03-08', 70, 'Fety ny vehivavy', '2023-03-12', '22:29:09'),
(60, 'TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Ampaherezonareo ny tanana miraviravy, ary hatanjaho ny lohalika malemy&quot; Isaia 35 : 3\nTAFIKA MASINA MAHARITRA\nIlazana isika fa hiarahana amin&#039;ny Fitandremana Ambohibao Toby ny fanaovana Tafika Masina, noho izany, eny @FLM Amboropotsy, ny fotoana, manomboka amin&#039;ny 9ora maraina, rahampitso Zoma 10 Mars 2023.\nFiadanan&#039;i Jesosy ho amintsika tsirairay avy!', '2023-03-09', 70, ' ', '2023-03-12', '22:29:38'),
(61, 'TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Mandehana any amin&#039;izao tontolo izao ianareo, ka mitoria ny filazantsara amin&#039;ny olombelona rehetra.&quot; Marka 16 : 15 \nMampatsiahy ny fotoanan&#039;ny Tafika Masina rahampitso, Zoma 3 Martsa, @ 8h30 ao am-piangonana ny fotoana. Tongava maro tompoko.\nTahian&#039;i Jesosy !\nNy Biraon&#039;ny TMM', '2023-03-02', 70, ' ', '2023-03-12', '22:30:52'),
(62, 'Mana : Fitiavana an&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary tiava an&#039;i Jehovah Andriamanitrao, ka tandremo mandrakariva Izay asainy hotandremana, dia ny lal&agrave;ny sy ny fitsipiny ary ny didiny.&quot;', '2023-04-06', 91, 'Deoteronomia 11 : 1', '2023-04-02', '14:09:21'),
(63, 'Mana : Fanompoana an&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa manompoa an&#039;i Jehovah Andriamanitrareo, dia hitahy ny haninao sy ny ranonao Izy; ary hesoriko aminao ny aretina.&quot;', '2023-04-07', 91, 'Eksodosy 23 : 25', '2023-04-02', '14:10:55'),
(64, 'Mana : Finoana Kristiana', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza manahy na inona na inona; fa aoka ny fivavahana sy ny fifonana mbamin&#039;ny fisaorana no ho entinareo manambara ny fangatahanareo amin&#039;Andriamanitra amin&#039;ny zavatra rehetra.&quot;', '2023-04-08', 91, 'Filipiana 4 : 6', '2023-04-02', '14:12:45'),
(65, 'Mana : Fitandremana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitandrema ianareo, fandrao manadino ny faneken&#039;i Jehovah Andriamanitrareo izay nataony taminareo ka manao sarin-javatra voasokitra ho anareo, araka ny endriky ny zavatra izay efa nandraran&#039;i Jehovah Andriamanitrao anao.&quot;', '2023-04-10', 91, 'Deoteronomia 4 : 23', '2023-04-02', '14:17:15'),
(66, 'Raharaha : TMM', 'FLM AMBOHIDRATRIMO\n\n&quot;Anaka, aoka tsy ho tia amin&#039;ny teny na amin&#039;ny lela isika, fa amin&#039;ny asa sy amin&#039;ny marina.&quot;\nI Jaona 3 : 18\n\nMampatsiahy ny fotoanan&#039;ny Tafika Masina rahampitso, Zoma 31 Martsa, @ 8h30 ao am-piangonana ny fotoana. Tongava maro tompoko.\nTahian&#039;i Jesosy !', '2023-03-30', 91, 'Ny Biraon&#039;ny TMM', '2023-04-02', '14:21:10'),
(67, 'Raharaha : Fiangonana', 'FLM AMBOHIDRATRIMO\n\nMampatsiahy an-tsika ny Asabotsy 18 martsa fiofanana ho an&#039;ny komity rehetra, na komity ny fiangonana na ny sampana , ny fandaminana dia samy manao izay ahatongavana any fa ny sakafo atoandro no hiantoan&#039;ny fiangonana, manentana hatrany moa ny fahatongavan-tsika fa zava-dehibe ny fiofanana ,dia mirary soa hatrany.', '2023-03-15', 91, ' ', '2023-04-02', '14:24:03'),
(68, 'Raharaha', 'FLM AMBOHIDRATRIMO\n\nMiarahaba an-tsika komity rehetra amin&#039;ny anaran&#039;i Jesosy, mampatsiahy an-tsika ny fivoriana amin&#039;ny alahady 19 martsa manomboka amin&#039;ny 6:30 maraina ,zava -dehibe no hodinihina ka dia manentana an-tsika ho tonga maro. Mirary soa dia samy ho tahian&#039;i Jesosy.', '2023-03-16', 91, ' ', '2023-04-02', '14:25:09'),
(69, 'Mana : Fanaovana sitrpony', 'FLM AMBOHIDRATRIMO\n\n&quot;mba handehananareo miendrika ny Tompo, hanaovana ny sitrapony amin&#039;ny zavatra rehetra, dia mahavokatra amin&#039;ny asa tsara rehetra sady mitombo amin&#039;ny fahalalana tsara an&#039;Andriamanitra,&quot;', '2023-04-11', 91, 'Kolosiana 1 : 10', '2023-04-02', '14:29:26'),
(70, 'Mana : Fahafahana', 'FLM AMBOHIDRATRIMO\n\n&quot;sady nahafaka antsika tamin&#039;ny fahefan&#039;ny maizina ka namindra antsika ho amin&#039;ny fanjakan&#039;ny Zanany malalany, Izay ananantsika fanavotana, dia ny famelana ny helotsika.&quot;', '2023-04-12', 91, 'Kolosiana 1 : 13 - 14', '2023-04-02', '14:31:27'),
(71, 'Mana : Fanomezam-pahasoavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa fahafatesana no tambin&#039;ny ota; ary fiainana mandrakizay no fanomezam-pahasoavana avy amin&#039;Andriamanitra ao amin&#039;i Kristy Jesoa Tompontsika.&quot;', '2023-04-13', 91, 'Romana 6 : 23', '2023-04-02', '14:37:12'),
(72, 'Mana : Fizahan-toetra ', 'FLM AMBOHIDRATRIMO\n\n&quot;Ry rahalahiko, ataovy ho fifaliana avokoa, raha iharan&#039;ny fakam-panahy samy hafa ianareo, satria fantatrareo fa ny fizahan-toetra ny finoanareo dia mahatonga faharetana. Ary aoka ny faharetana hisy asa tanteraka, mba ho tanteraka sy tonga ohatra ianareo, ka tsy hisy tsy ampy na inona na inona.&quot;', '2023-04-14', 91, 'Jakoba 1 : 2 - 4', '2023-04-02', '14:38:37'),
(73, 'Mana : Faharetana', 'FLM AMBOHIDRATRIMO\n\n&quot;ary Izy no talohan&#039;ny zavatra rehetra, sady ao aminy no aharetan&#039;ny zavatra rehetra.&quot;', '2023-04-15', 91, 'Kolosiana 1 : 17', '2023-04-02', '14:41:03'),
(74, 'Mana : Fifankatiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa antomotra ny faran&#039;ny zavatra rehetra; koa hendre ka mahonona tena ho amin&#039;ny fivavahana. Ary mihoatra noho ny zavatra rehetra, mifankatiava tsara; fa ny fitiavana manarona fahotana maro.&quot;', '2023-04-03', 92, 'I Petera 4 : 7 - 8', '2023-04-02', '14:50:49'),
(75, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Alatsinainy 03 Aprily\n\nIarahana amin&#039;ny SALoMa sy VLM\n\n** 06 Ora hariva \n- Mitarika : Nenitoa RAVAOARY Estera Filohan&#039;ny VLM\n- TT : Gen 15 : 12-16 ; Nenitoa Fafah Birao SALoMa\n- Asa 7 : 2-19 ; Rtoakely Fifaliana Birao SALoMa\n- Filazantsara : Mar. 11:1-11 ; Nenitoa Haingo Birao VLM\n- Toriteny : Matio 21:33-45 ; Katekista RAKOTONIRINA Tovo Mbolatiana\n- Filazandraharaha : Tompon&#039;anjara ny andro manaraka - Biraompiangonana', '2023-04-03', 92, ' ', '2023-04-03', '07:21:53'),
(76, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Talata 04 Aprily\n\nIarahana amin&#039;ny KTLM sy FBL\n\n** 06 Ora hariva\n- Mitarika : Nenitoa RANDRIAMANANTSAINA Tantely - Filohan&#039;ny KTLM\n- TT : Salamo 24:1-10 ; Nenitoa Voahangy Birao FBL\n- Epistily : I Tes. 2:17-19 ; Nenitoa Linah Birao FBL\n- Filazantsara : Matio 10:28-38 ; Ars&egrave;ne Birao KTLM\n- Toriteny : Marka 8:31-38 ; Toto Hanta Biraompiangonana\n- Filazandraharaha : Tompon&#039;anjara ny andro manaraka - Biraompiangonana', '2023-04-04', 92, ' ', '2023-04-03', '07:32:14'),
(77, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Alarobia 05 Aprily\n\nIarahana amin&#039;ny FDL sy FiFiL ary TMM\n\n** 05 Ora hariva : Fanasan-tongotra iarahana amin&#039;ny mpiandry sy mpiomana\n- Mitarika : Nenitoa RAZAFINDRAZERY Doroth&eacute;e, Filoha TMM\n- Vakiteny 1 : Isaia 53:1-12 ; Dadatoa Naina Mpiandry\n- Vakiteny 2 : Kolosiana 3:12-15 ; Dadatoa Michel Mpiomana\n- Toriteny : Jaona 13:1-17 ; Nenitoa Armandine Mpiandry\n\n** 06 Ora hariva :\n- Mitarika : Dadatoa RATOVONIRINA Rivolalaina - Filohan&#039;ny FDL\n- TT : Deo. 16:1-8; Nenitoa Hanitra Mpiandry\n- Epistily : Hebreo 9:22-28; Dadatoa Jean de Dieu Birao FDL\n- Filazantsara : Jaona 3:16-17 ; Dadatoa Nirina Birao FiFiL\n- Jaona 1:29-30 ; Nenitoa RABAKONANDRIANINA Elisabeth - Filohan&#039;ny FiFiL\n- Filazandraharaha : Tompon&#039;anjara ny andro manaraka - Biraompiangonana', '2023-04-05', 92, ' ', '2023-04-03', '07:33:51'),
(78, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Alakamisy  06 Aprily\n\n** 09 Ora maraina : Fandraisana Fanasan&#039;ny Tompo\n- Alitara sy toriteny : Pastora RANDRIANIRINA Solofoson Gilbert \n- Vavaka fanombohana sy famaranana : Nenitoa Seheno Biraompiangonana\n- TT:Eks. 12:3-14, Diakona\n- Epistily : I Kor.10:16-17 ; Diakona\n- Filazantsara : Jaona 13 : 1-15 ; Pastora RANDRIANIRINA Solofoson Gilbert\n- Toriteny : Matio 26 :17-19 ; Pastora RANDRIANIRINA Solofoson Gilbert \n- Filazandraharaha : Tompon&#039;anjara ny andro manaraka - Biraompiangonana\n\n** 06 Ora hariva : Fandraisana Fanasan&#039;ny Tompo\n- Alitara sy toriteny : Pastora RAKOTOARISOA Mbolatiana\n- Vavaka fanombohana sy famaranana : Katekista RAKOTONIRINA Tovo M.\n- TT:Eks. 12:3-14;Diakona\n- Epistily : I Kor.10:16-17 ; Diakona\n- Filazantsara : Jaona 13 : 1-15 ; Pastora RAKOTOARISOA Mbolatiana\n- Toriteny : Matio 26 :17-19 ; Pastora RAKOTOARISOA Mbolatiana\n- Filazandraharaha : Tompon&#039;anjara ny andro manaraka - Biraompiangonana\n', '2023-04-06', 92, ' ', '2023-04-03', '07:40:03'),
(79, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Zoma 07 Aprily\n\nIarahana amin&#039;ny FS-FLM sy ny DEPARTEMANTA rehetra\n\n** 06 Ora hariva\n- Mpitarika : Ramatoa RAVAOARIVELO Esther\n- TT : Isa 50:6-9 ; KP Tantely FS-FLM \n- TV : Matio 27:51-66 ; Dadatoa Tefy DHM\n- Filazantsara : Lioka 23:47-56 ; Eric Filoha Departemanta Serasera\n- Toriteny : Matio 26:30-27-50 ; Pastora RAKOTOARISOA Mbolatiana\n- LITANIA\n- Filazandraharaha : Biraompiangonana\n', '2023-04-07', 92, ' ', '2023-04-03', '07:44:17'),
(80, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Alahady 09 Aprily : PASKA\n\n** O8 Ora maraina : Fandraisana ny Fanasan&#039;nyTompo\n- Alitara sy toriteny : Pastora RAKOTOARISOA Mbolatiana\n- Vavaka fanombohana sy famaranana: Katekista RAKOTONIRINA Tovo Mbolatiana\n- TT : Isaia 52 : 13-15 ; Diakona\n- Epistily: I Kor. 15 : 12-21 ; Diakona\n- Filazantsara : Mat 28 : 1-8 ; Pastora RAKOTOARISOA Mbolatiana\n- Toriteny : Lioka 24 : 1-9 ; Pastora RAKOTOARISOA Mbolatiana\n- Filazandraharaha : Mpitantsoratry ny Fiangonana', '2023-04-09', 92, ' ', '2023-04-03', '07:45:44'),
(81, 'Fiangonana : Programa Paska', 'FLM AMBOHIDRATRIMO\n\nFandaharam-potoana Paska 2023\nAnio Alatsinainy 10 Aprily : PASKA FAHAROA\n\nENY AMIN&#039;NY FLM MAHITSY FANANTENANA\n** 09 Ora maraina : Fandraisana ny Fanasan&#039;ny Tompo\n\n- Alitara sy toriteny : Pastora RANDRIANIRINA Solofoson Gilbert \n- TT : Hosea 13 : 14\n- Epistily :II Kor 5:14-21\n- Filazantsara : Mat. 28 :9-15 \n- Toriteny : Jao. 20 :11-18\n- Filazandraharaha : Biraon&#039;ny Fitandremana\n- Fandraisana ny Fanasan&#039;ny Tompo\n- Fiaraha-misakafon&#039;ny Fitandremana \n- Fitsangatsanganan&#039;ny Fitandremana', '2023-04-10', 92, ' ', '2023-04-03', '08:03:41'),
(82, 'Fanokanana FDL', 'FLM AMBOHIDRATRIMO\n\n&quot;Matokia, mitsang&agrave;na, miantso anao Izy.&quot; Marka 10 : 49b \n\nAlahady 16 avril 2023.\n\nFanokanana ny antoko-pihira FDL AMBOHIDRATRIMO.\n\nMisy ny fidirana roa.\n- Fidirana voalohany : manomboka @7ora maraina.\n- Fiderana faharoa : manomboka @9ora 30&#039; maraina.', '2023-04-15', 104, ' ', '2023-04-15', '21:46:13'),
(83, 'Mana : Voninahitra ho an&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Voninahitra any amin&#039;ny avo Indrindra ho an&#039;Andriamanitra! Ary fiadanana ho ety ambonin&#039;ny tany amin&#039;ny olona ankasitrahany.&quot;', '2023-04-17', 104, 'Lioka 2 : 14', '2023-04-15', '21:59:25'),
(84, 'Mana : Fiandrasana ny ondry', 'FLM AMBOHIDRATRIMO\n\n&quot;Andraso ny ondrin&#039;Andriamanitra izay eo aminareo, mitandrina azy tsy an-tery, fa amin&#039;ny sitrapo,[araka an&#039;Andriamanitra]; tsy amin&#039;ny fitiavana harena maloto, fa amin&#039;ny zotom-panahy;&quot;', '2023-04-18', 104, 'I Petera 5 : 2', '2023-04-15', '22:01:39'),
(85, 'Mana : Iraka', 'FLM AMBOHIDRATRIMO\n\n&quot;koa mandehana ianareo, dia ataovy mpianatra ny firenena rehetra, manao batisa azy ho amin&#039;ny anaran&#039;ny Ray sy ny Zanaka ary ny Fanahy Masina.&quot;', '2023-04-19', 104, 'Matio 28 : 19', '2023-04-15', '22:03:24'),
(86, 'Mana : Fitandremana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary hoy Izy tamin&#039;ny olona: Mitandrema, ka miarova tena mba tsy ho azon&#039;ny fieremana ianareo; fa ny ain&#039;ny olona tsy miankina amin&#039;ny habetsahan&#039;ny zavatra ananany.&quot;', '2023-04-20', 104, 'Lioka 12 : 15', '2023-04-15', '22:04:08'),
(87, 'Mana : Mifalia', 'FLM AMBOHIDRATRIMO\n\n&quot;Mifalia sy miravoravoa ianareo, fa lehibe ny valim-pitianareo any an-danitra; fa toy izany ihany no nanenjehany ny mpaminany izay talohanareo.&quot;', '2023-04-21', 104, 'Matio 5 : 12', '2023-04-15', '22:05:36'),
(88, 'Mana : Fiarovana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary, indro, Izaho momba anao ka hiaro anao amin&#039;izay lalan-kalehanao rehetra ary hampody anao indray ho amin&#039;ity tany ity; fa tsy handao anao Aho mandra-panaoko izay voalazako taminao.&quot;', '2023-04-22', 104, 'Genesisy 28 : 15', '2023-04-15', '22:07:32'),
(89, 'Mana : Fiadivana ny ady tsara', 'FLM AMBOHIDRATRIMO\n\n&quot;Miadia ny ady tsaran&#039;ny finoana, hazony ny fiainana mandrakizay; fa ho amin&#039;izany no niantsoana anao koa sy nanaovanao ilay fanekena tsara teo imason&#039;ny vavolombelona maro.&quot;', '2023-04-24', 104, 'I Timoty 6 : 12', '2023-04-15', '22:09:01'),
(90, 'Mana : Fiaretana', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa satria niaritra tamin&#039;ny nofo Kristy, dia alao mba ho fiadianareo izany saina izany; fa izay niaritra tamin&#039;ny nofo dia efa afaka tamin&#039;ny ny ota;  mba tsy handanianareo ny andro sisa iainanareo amin&#039;ny nofo araka ny filan&#039;ny olona intsony, fa araka ny sitrapon&#039;Andriamanitra.&quot;', '2023-04-25', 104, 'I Petera 4 : 1 - 2', '2023-04-15', '22:10:46'),
(91, 'Mana : Fitandremana', 'FLM AMBOHIDRATRIMO\n\n&quot;Tandremo ny tenanao sy ny fampianaranao, ka mahareta amin&#039;izany; fa raha manao izany ianao, dia hamonjy ny tenanao sy izay mihaino anao.&quot;', '2023-04-26', 104, 'I Timoty 4 : 16', '2023-04-15', '22:12:10'),
(92, 'Mana : Hafatra maha kristiana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fantatsika fa avy amin&#039;Andriamanitra isika, ary izao tontolo izao kosa dia mipetraka eo amin&#039;ilay ratsy avokoa. Ary fantatsika fa tonga ny Zanak&#039;Andriamanitra ka efa nanome antsika ny fahazavan-tsaina, mba ho fantatsika ilay marina; ary isika ao amin&#039;ilay marina, dia ao amin&#039;i Jesoa Kristy Zanany. Izy no Andriamanitra marina sy fiainana mandrakizay. &quot;', '2023-04-27', 104, 'I Jaona 5 : 19 - 20', '2023-04-15', '22:13:54'),
(93, 'Mana : fitsinjivon&#039;i Tompo', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ny mason&#039;ny Tompo dia mitsinjo ny marina, Ary ny sofiny mihaino ny fitarainany, Fa ny tavan&#039;ny Tompo dia tezitra amin&#039;ny mpanao ratsy.&quot;', '2023-04-28', 104, 'I Petera 3 : 12', '2023-04-15', '22:15:39'),
(94, 'Mana : Fanekena', 'FLM AMBOHIDRATRIMO\n\n&quot;Izay rehetra mand&agrave; ny Zanaka no tsy manana ny Ray koa; izay manaiky ny Zanaka no manana ny Ray koa.&quot;', '2023-04-29', 104, 'I Jaona 2 : 23', '2023-04-15', '22:16:47'),
(95, 'Mana : Jesosy no lalana', 'FLM AMBOHIDRATRIMO\n\n&quot;Hoy Jesoa taminy: Izaho no lalana sy fahamarinana ary fiainana; tsy misy olona mankany amin&#039;ny Ray, afa-tsy amin&#039;ny alalako.&quot;', '2023-05-01', 104, 'Jaona 14 : 6', '2023-04-15', '22:18:04'),
(96, 'Mana : Fanekena', 'FLM AMBOHIDRATRIMO\n\n&quot;Na iza na iza manaiky fa Zanak&#039;Andriamanitra Jesoa, dia mitoetra ao aminy Andriamanitra, ary izy kosa ao amin&#039;Andriamanitra.&quot;', '2023-05-02', 104, 'I Jaona 4 : 15', '2023-04-15', '22:20:15'),
(97, 'Mana : Voafidy', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ianareo kosa dia taranaka voafidy, fanjaka-mpisorona, firenena masina, olona nalain&#039; Andriamanitra ho an&#039;ny tenany mba hilazanareo ny hatsaran&#039;ilay niantso anareo hiala tamin&#039;ny maizina ho amin&#039;ny fahazavany mahagaga.&quot;', '2023-05-03', 104, '1 Petera 2:9', '2023-04-15', '22:21:49'),
(98, 'Mana : Fahafantarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Raha fantatrareo fa marina Izy, dia fantaro fa izay rehetra manao ny marina no zanany naterany.&quot;', '2023-05-04', 104, 'I Jaona 2 : 29', '2023-04-15', '22:22:45'),
(99, 'Mana : vavaka', 'FLM AMBOHIDRATRIMO\n\n&quot;ary raha fantatsika fa mihaino antsika Izy, na inona na inona no angatahintsika, dia fantatsika fa azontsika izay angatahintsika aminy.&quot;', '2023-05-05', 104, 'I Jaona 5 : 15', '2023-04-15', '22:23:32'),
(100, 'Mana : Fahankal&agrave;na ny ratsy', 'FLM AMBOHIDRATRIMO\n\n&quot;Hianareo izay tia an&#039;i Jehovah, mankahal&agrave; ny ratsy; Miaro ny fanahin&#039;ny olony masina Izy Ary mamonjy azy amin&#039;ny tanan&#039;ny ratsy fanahy.&quot;', '2023-05-06', 104, 'Salamo 97 : 10', '2023-04-15', '22:25:14'),
(101, 'Raharaha : Fanorenana', 'FLM AMBOHIDRATRIMO\n\n&quot;Izay miray Amiko, ary Izaho aminy, dia mamoa be izy,fa raha misaraka Amiko kosa ianareo, dia tsy mahay manao na inona na inona&quot; Jaona 15:5\n\nSalama tompoko ! \nToy izao ny fandaminana ny amin&#039;ny vokatra FANORENANA eo ivelany amin&#039;ny Alahady 23 avril.\nFDL: Nem 400isa sy Jus 40 tavoahangy\nFBL: Salade de pate: 30 000ar\nFIFIL: Sandwich 30000ar\nVLM: Katsaka 20 000ar\nTMM: Mine Sao 20 000 ar\nKTLM: Compos&eacute; 50000ar\nSALOMA: Yaourt 200isa\nSKOTO: Sambos 400isa\nToto Hanta: Lasopy 60000ar\nFANAMARIHANA:\n- Efa afaka maka ny vola ny sampana, ao @ Dtoa Lalaina, manomboka rapitso Talata. \n- Sakafo efa masaka sy vonona ho amidy no hoentina mialoha ny @ 8ora  maraina, koa anjaran&#039;ny sampana no manao fandaminana anatiny ny amin&#039;izany.\n- Samia mitondra am-bavaka fa maro ny sahanintsika sampana tsirairay.\nMankasitraka tompoko!  \nNy Biraon&#039;ny  FANORENANA.', '2023-04-17', 106, ' ', '2023-04-17', '18:57:45'),
(102, 'Mana : Fandinihana ny Teniny', 'FLM AMBOHIDRATRIMO\n\n&quot;Izay mandinika ny teny no hahita soa; Ary izay matoky an&#039;i Jehovah no ho sambatra.&quot;', '2023-05-08', 168, 'Ohabolana 16 : 20', '2023-06-18', '08:02:46'),
(103, 'Mana : Fananarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa tsy nitondra na inona na inona ho amin&#039;izao tontolo izao isika, sady hita fa tsy hahatondra na inona na inona hiala.&quot; ', '2023-05-09', 168, 'I Timoty 6 : 7', '2023-06-18', '08:03:19'),
(104, 'Mana : Toky omena anao', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary raha madio sy mahitsy ianao, dia hifoha hamonjy anao tokoa Izy ary hampiadana indray ny fonenan&#039;ny fahamarinanao&quot;', '2023-05-11', 168, 'Joba 8 : 6', '2023-06-18', '08:10:34'),
(105, 'Mana : Fisaorana', 'FLM AMBOHIDRATRIMO\n\n&quot;Isaorana anie Andriamanitra, Rain&#039;i Jesoa Kristy Tompontsika, Izay niteraka antsika indray araka ny haben&#039;ny famindram-pony ho amin&#039;ny fanantenana velona tamin&#039;ny nitsanganan&#039;i Jesoa Kristy tamin&#039;ny maty,&quot;', '2023-05-10', 168, 'I Petera 1 : 3', '2023-06-18', '08:11:02'),
(106, 'Mana : Firariana ny soa', 'FLM AMBOHIDRATRIMO\n\n&quot;Mahazoa fahendrena, mahazoa fahalalana; Fa aza hadinoina na ihemorana ny teny aloaky ny vavako.&quot;', '2023-05-12', 168, 'Ohabolana 4 : 5', '2023-06-18', '08:11:55'),
(107, 'Mana : Fietrena', 'FLM AMBOHIDRATRIMO\n\n&quot;Miraisa saina. Aza mihevitra izay hiavonavonana, fa aoka mba ho zatra amin&#039;ny fietrena ianareo. Aza manao ny tenanareo ho hendry.&quot;', '2023-05-13', 168, 'Romana 12 : 16', '2023-06-18', '08:13:12'),
(108, 'Mana : Fifaliana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mifalia amin&#039;i Jehovah, ary ravoravoa, ianareo olo-marina, ary mihobia, ianareo mahitsy fo rehetra.&quot;', '2023-05-15', 168, 'Salamo 32 : 11', '2023-06-18', '08:13:37'),
(109, 'Mana : Sakaizany isika', 'FLM AMBOHIDRATRIMO\n\n&quot;Tsy hataoko hoe mpanompo intsony ianareo, fa ny mpanompo tsy mahalala izay ataon&#039;ny tompony; fa efa nataoko hoe sakaiza ianareo, satria izay rehetra reko tamin&#039;ny Raiko no nambarako taminareo.&quot;', '2023-05-16', 168, 'Jaona 15 : 15', '2023-06-18', '08:14:12'),
(110, 'Mana : Finoana marina', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary noho izany koa no iaretako izao zavatra izao, ka tsy menatra aho, satria fantatro Izay inoako, ary matoky aho fa Izy dia mahatahiry ilay zavatra natolotro Azy mandra-pihavin&#039;izay andro izay.&quot;', '2023-05-17', 168, 'II Timoty 1 : 12', '2023-06-18', '08:14:56'),
(111, 'Mana : Fiakarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Eny, nivoaka avy tamin&#039;ny Ray Aho ka tonga amin&#039;izao tontolo izao; ary hiala amin&#039;izao tontolo izao indray Aho ka hankany amin&#039;ny Ray.&quot;', '2023-05-18', 168, 'Jaona 16 : 28', '2023-06-18', '08:15:39'),
(112, 'Mana : Fisaorana', 'FLM AMBOHIDRATRIMO\n\n&quot;ka misaotra ny Ray, Izay nampahamendrika antsika hanana anjara amin&#039;ny lovan&#039;ny olona masina eo amin&#039;ny mazava&quot;', '2023-05-19', 168, 'Kolosiana 1 : 12', '2023-06-18', '08:16:05'),
(113, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa toy izao no nitiavan&#039;Andriamanitra izao tontolo izao: nomeny ny Zanani-lahy Tokana, mba tsy ho very izay rehetra mino Azy, fa hanana fiainana mandrakizay.&quot;', '2023-05-20', 168, 'Jaona 3 : 16', '2023-06-18', '08:16:43'),
(114, 'Mana : Fomba fivavahana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary raha mivavaka ianareo, dia aza mba manao teny maro foana tahaka ny jentilisa; Fa ataony ho ny hamaroan&#039;ny teniny no hihainoana azy. Koa aza manahaka azy ianareo; fa fantatry ny Rainareo izay tokony ho anareo, raha tsy mbola mangataka aminy aza ianareo.&quot;', '2023-05-22', 168, 'Matio 6 : 7 - 8', '2023-06-18', '08:17:16'),
(115, 'Mana : Fisaorana', 'FLM AMBOHIDRATRIMO\n\n&quot;Misaora an&#039;i Jehovah, ry fanahiko; Ary aza misy hadinoinao ny fitahiany rehetra&quot;', '2023-05-23', 168, 'Salamo 103 : 2', '2023-06-18', '08:17:41'),
(116, 'Mana : Ny ao amin&#039;i Kristy', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa raha velona isika, dia velona ho an&#039;ny Tompo; ary raha maty isika, dia maty ho an&#039;ny Tompo; koa amin&#039;izany, na velona na maty isika, dia an&#039;ny Tompo ihany.&quot;', '2023-05-24', 168, 'Romana 14 : 8', '2023-06-18', '08:18:14'),
(117, 'Mana : Fanomezana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa tsy nomen&#039;Andriamanitra fanahy osa isika, fa fanahy mahery sy fitiavana ary fahononan-tena.&quot;', '2023-05-25', 168, 'II Timoty 1 : 7', '2023-06-18', '08:18:48'),
(118, 'Mana : Fangatahana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mamindr&agrave; fo aminay, Jehovah o, mamindr&agrave; fo aminay; Fa tototry ny fanamavoana loatra izahay&quot;', '2023-05-26', 168, 'Salamo 123 : 3', '2023-06-18', '08:19:20'),
(119, 'Mana : Tori-teny', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa ny finoana dia avy amin&#039;ny tori-teny, ary ny tori-teny kosa avy amin&#039;ny tenin&#039;i Kristy.&quot;', '2023-05-27', 168, 'Romana 10 : 17', '2023-06-18', '08:19:55'),
(120, 'Mana : Pentekosta', 'FLM MABOHIDRATRIMO\n\n&quot;Ary rehefa nivavaka izy, dia nihovitrovitra ny trano izay niangonany; dia feno ny Fanahy Masina izy rehetra ka nitory ny tenin&#039;Andriamanitra tamin&#039;ny fahasahiana.&quot;\n\nMiarahaba an-tsika rehetra nahatratra ny fetin&#039;ny Pentekosta. Ho tahin&#039;i Jesosy hatrany tompoko.', '2023-05-28', 168, 'Asan&#039;ny Apostoly 4:31', '2023-06-18', '08:20:34'),
(121, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Na dia levona aza ny nofoko sy ny foko, dia mbola vatolampin&#039;ny foko sy anjarako mandrakizay Andriamanitra.&quot;', '2023-05-29', 168, 'Salamo 73 : 26', '2023-06-18', '08:21:03'),
(122, 'Mana : Fanomezana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa fahasoavana no namonjena anareo amin&#039;ny finoana; ary tsy avy aminareo izany, fa fanomezana avy amin&#039;Andriamanitra&quot;', '2023-05-30', 168, 'Efesiana 2 : 8', '2023-06-18', '08:21:34'),
(123, 'Mana : Fahaizana azo', 'FLM AMBOHIDRATRIMO\n\n&quot;Mahay ny zavatra rehetra aho ao amin&#039;ilay mampahery ahy.&quot;', '2023-05-31', 168, 'Filipiana 4 : 13', '2023-06-18', '08:22:08'),
(124, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary ny finoana no fahatokiana ny amin&#039;ny zavatra antenaina, fanehoana ny zavatra tsy hita.&quot;', '2023-06-01', 168, 'Hebreo 11 : 1', '2023-06-18', '08:22:41'),
(125, 'Mana : Fisaorana', 'FLM AMBOHIDRATRIMO\n\n&quot;Misaora amin&#039;ny zavatra rehetra; fa izany no sitrapon&#039;Andriamanitra ao amin&#039;i Kristy Jesoa ho anareo.&quot;', '2023-06-02', 168, 'I Tesaloniana 5 : 18', '2023-06-18', '08:23:04'),
(126, 'Mana : Iraka omena', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitoria ny teny, mazotoa, na amin&#039;ny fotoana, na tsy amin&#039;ny fotoana, mandrese lahatra, mamporisiha, mananara mafy amin&#039;ny fahari-po sy ny fampianarana rehetra.&quot;', '2023-06-03', 168, 'II Timoty 4 : 2', '2023-06-18', '08:23:32'),
(127, 'Andro : Reny', 'FLM AMBOHIDRATRIMO\n\n&quot;Hitahy anao anie Jehovah ka hiaro anao; Hampamirapiratra ny tavany aminao anie Jehovah ka hamindra fo aminao; Hanandratra ny tavany aminao anie Jehovah ka hanome anao fiadanana.&quot;\n\nMiarahaba ny Reny rehetra nahatratra ny fety anio. Ho tahiana hatrany ianareo araka ny Teniny.', '2023-06-04', 168, 'Nomery 6 : 24 - 26', '2023-06-18', '08:24:21'),
(128, 'Mana : Finoana arahana Asa', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa maty ny tena, raha tsy misy fanahy, ary maty toy izany koa ny finoana, raha tsy misy asa.&quot;', '2023-06-05', 168, 'Jakoba 2 : 26', '2023-06-18', '08:24:56'),
(129, 'Mana : Fahendrena', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa Jehovah no manome fahendrena; Avy amin&#039;ny vavany no ihavian&#039;ny fahalalana sy ny fahazavan-tsaina.&quot;', '2023-06-06', 168, 'Ohabolana 2 : 6', '2023-06-18', '08:25:25'),
(130, 'Mana : Fnagatahana amin&#039;ny finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Nefa aoka hangataka amin&#039;ny finoana izy ka tsy hiahanahana akory; fa izay miahanahana dia toy ny alon-dranomasina entin&#039;ny rivotra ka atopatopany.&quot;', '2023-06-07', 168, 'Jakoba 1 : 6', '2023-06-18', '08:25:58'),
(131, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa tiava ny fahavalonareo, ary manaova soa, dia mampisambora, fa aza kivy na amin&#039;inona na amin&#039;inona, dia ho lehibe ny valim-pitianareo, ary ho zanaky ny Avo Indrindra ianareo; fa Izy mora fanahy amin&#039;izay tsy misaotra sy ny ratsy fanahy.&quot;', '2023-06-08', 168, 'Lioka 6 : 35', '2023-06-18', '08:26:30'),
(132, 'Mana : Fiambenana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ho avy faingana Aho; tano mafy izay anananao, mba tsy hisy haka ny satro-boninahitrao.&quot;', '2023-06-09', 168, 'Apokalypsy 3 : 11', '2023-06-18', '08:28:15'),
(133, 'Mana : Fitandremana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary izay hendry ao amin&#039;ny olona dia hampianatra ny maro; nefa ho lavon&#039;ny sabatra sy ny lelafo sy ny famaboana ary ny fandrobana elaela ihany izy.&quot;', '2023-06-10', 168, 'Daniela 11 : 33', '2023-06-18', '08:29:24'),
(134, 'Mana : Firariana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ny fahasoavana anie ho amin&#039;izay rehetra tia an&#039;i Jesoa Kristy Tompontsika amin&#039;ny fitiavana tsy mety levona.&quot;', '2023-06-12', 168, 'Efesiana 6 : 24', '2023-06-18', '08:29:57'),
(135, 'Mana : Fiarahana ao Aminy', 'FLM AMBOHIDRATRIMO\n\n&quot;Voahombo miaraka amin&#039;i Kristy amin&#039;ny hazo fijaliana aho, ary tsy izaho intsony no velona, fa Kristy no velona ato anatiko; fa izay ivelomako ankehitriny eo amin&#039;ny nofo dia ivelomako amin&#039;ny finoana ny Zanak&#039;Andriamanitra, Izay efa tia ahy ka nanolotra ny tenany hamonjy ahy.&quot;', '2023-06-13', 168, 'Galatiana 2 : 20', '2023-06-18', '08:30:27'),
(136, 'Mana : Fitiavana ny rahalahiny', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary izao no didy efa azontsika taminy: Izay tia an&#039;Andriamanitra dia tsy maintsy tia ny rahalahiny koa.&quot;', '2023-06-14', 168, 'I Jaona 4 : 21', '2023-06-18', '08:31:14'),
(137, 'Mana : Fahatokisana nomena', 'FLM AMBOHIDRATRIMO\n\n&quot;Mahatoky Andriamanitra, Izay nahatonga ny fiantsoana anareo hanananareo firaisana amin&#039;ny Zanany, dia Jesoa Kristy Tompontsika.&quot;', '2023-06-15', 168, 'I Korintiana 1 : 9', '2023-06-18', '08:32:30'),
(138, 'Mana : Fananarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary ianareo izay mbola tanora fanahy kosa, dia maneke ny loholona. Eny, samia misikina fanetren-tena ianareo ka mifanompoa; fa Andriamanitra manohitra ny miavonavona, fa manome fahasoavana ho an&#039;ny manetry tena&quot;', '2023-06-16', 168, 'I Petera 5 : 5', '2023-06-18', '08:33:02'),
(139, 'Mana : Fanetren-tena', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa mitafia famindram-po sy fiantrana, fahamoram-panahy, fanetren-tena, fahalemem-panahy, fandeferana, araka ny olom-boafidin&#039;Andriamanitra sady masina no malala.&quot;', '2023-06-17', 168, 'Kolosiana 3 : 12', '2023-06-18', '08:33:48'),
(140, 'Andro : Ray', 'FLM AMBOHIDRATRIMO\n\n&quot;Dia hitahy anao tokoa Aho ary hahamaro dia hahamaro ny taranakao, ho tahaka ny kintana eny amin&#039;ny lanitra sy ho tahaka ny fasika izay any amoron-dranomasina; ary ny taranakao hahazo ny vavahadin&#039;ny fahavalony&quot;\n\nMiarahaba ny Ray rehetra nahatratra izao fetin&#039;ny Ray izao. Jesosy homba sy hitahy mandrakariva araka ny Teniny.', '2023-06-18', 168, 'Genesisy 22 : 17', '2023-06-18', '08:34:44'),
(141, 'Mana : Fandaminana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ny fahaizana mandamina tsara no entonao miady, Ary raha maro ny mpanolo-tsaina, dia misy famonjena.&quot;', '2023-06-19', 168, 'Ohabolana 24:6', '2023-06-18', '10:39:22'),
(142, 'Mana : Fangatahana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ampianaro hanao ny sitraponao aho; Fa Hianao no Andriamanitro; Aoka ny Fanahinao tsara no hitarihanao ahy amin&#039;izay tany marina.&quot;', '2023-06-20', 168, 'Salamo 143:10', '2023-06-18', '10:44:20'),
(143, 'Mana : Fiantsoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Indro, efa mitsangana eo am-baravarana Aho ka mandond&ograve;na; raha misy mihaino ny feoko ka mamoha ny varavarana, dia hiditra ao aminy Aho ka hiara-misakafo aminy, ary izy amiko.&quot;', '2023-06-21', 168, 'Apokalypsy 3:20', '2023-06-18', '10:45:12'),
(144, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Izay hatramin&#039;ny voalohany, dia izay efa renay, izay efa hitan&#039;ny masonay, izay efa nojerenay sady efa notsapain&#039;ny tananay, dia ny amin&#039;ny Teny Fiainana&quot;', '2023-06-22', 168, 'I Jaona 1 : 1', '2023-06-18', '10:46:06'),
(145, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary ankehitriny dia ireto telo ireto no mitoetra: ny finoana, ny fanantenana, ny fitiavana: fa ny fitiavana no lehibe amin&#039;ireo.&quot;', '2023-06-23', 168, 'I Korintiana 13 : 13', '2023-06-18', '10:46:41'),
(146, 'Mana : Fianana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa mahasoa kely ihany ny fampiasana ny tena; fa ny toe-panahy araka an&#039;Andriamanitra no mahasoa amin&#039;ny zavatra rehetra ka manana ny teny fikasana ny amin&#039;ny fiainana ankehitriny sy ny ho avy koa.&quot;', '2023-06-24', 168, 'I Timoty 4 : 8', '2023-06-18', '10:47:27'),
(147, 'Mana : Fiantsoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mihainoa ianareo, ka mandrenesa ny feoko; Mitandrema, ka mandrenesa ny teniko.&quot;', '2023-06-26', 168, 'Isaia 28 : 23', '2023-06-18', '10:48:08'),
(148, 'Mana : Fananarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa tsy misy takona izay tsy ho hita, na miafina izay tsy ho fantatra sy tsy haseho.&quot;', '2023-06-27', 168, 'Lioka 8 : 17', '2023-06-18', '10:48:48'),
(149, 'Mana : Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa iray no Andriamanitra, ary iray no Mpanalalana amin&#039;Andriamanitra sy ny olona, dia Kristy Jesoa, Izay olona, sady nanolotra ny tenany ho avotra hisolo ny olona rehetra, dia zavatra ho fitory amin&#039;izao androny izao. &quot;', '2023-06-28', 168, 'I Timoty 2 : 5 - 6', '2023-06-18', '10:49:42'),
(150, 'Mana : Fiambenana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mitandrema, miambena, ka mivavaha; fa tsy fantatrareo izay hihavian&#039;ny fotoana.&quot;', '2023-06-29', 168, 'Marka 13 : 33', '2023-06-18', '10:50:28'),
(151, 'Mana : Lova', 'FLM AMBOHIDRATRIMO\n\n&quot;Ny voafaritra ho anjarako dia eo amin&#039;ny tany mahafinaritra; eny, manan-dova tsara aho.&quot;', '2023-06-30', 168, 'Salamo 16:6', '2023-06-18', '10:52:01'),
(152, 'Mana : Fahasoavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Dia nitondra ahy ho any amin&#039;ny malalaka Izy; namonjy ahy Izy, satria tiany aho. Nanisy soa ahy araka ny fahamarinako Jehovah; Araka ny fahadiovan&#039;ny tanako no namaliany ahy.&quot;', '2023-07-01', 182, 'II Samoela 22 : 20 - 21', '2023-06-18', '11:08:13'),
(153, 'Mana : Fitadiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary hitady Ahy ianareo, dia ho hitanareo Aho, raha katsahinareo amin&#039;ny fonareo rehetra.&quot;', '2023-07-03', 168, 'Jeremia 29:13', '2023-06-18', '11:10:08'),
(154, 'Mana : Antso', 'FLM AMBOHIDRATRIMO\n\n&quot;Hianareo no fahazavan&#039;izao tontolo izao. Tsy azo afenina izay tan&agrave;na miorina eo an-tampon-tendrombohitra.&quot;', '2023-07-04', 183, 'Matio 5:14', '2023-06-18', '11:11:55');
INSERT INTO `hafatra` (`idHafatra`, `hafatraHeader`, `hafatraBody`, `hafatraDaty`, `numHafatra`, `hafatraFoot`, `dateH`, `heureH`) VALUES
(155, 'Mana : Fiankinana', 'FLM AMBOHIDRATRIMO\n\n&quot;Nahoana no mitanondrika ianao ry fanahiko? ary nahoana no mitoloko ato anatiko ianao? mananten&agrave; an&#039;Andriamanitra, fa mbola hidera Azy ihany aho. Izy no famonjena ny tavako sady Andriamanitro.&quot;', '2023-07-05', 168, 'Salamo 43:5', '2023-06-18', '11:13:56'),
(156, 'Mana : Fananarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ny fitiavam-bola no fototry ny ratsy rehetra, koa ny sasany izay fatra-pitady izany dia efa voavily niala tamin&#039;ny finoana ka nanindrona ny tenany tamin&#039;ny alahelo be.&quot;', '2023-07-06', 168, '1 Timoty 6:10', '2023-06-18', '11:15:01'),
(157, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary izao no fitiavana, dia ny handehanantsika araka ny didiny. Izany no didy, tahaka ny efa renareo hatramin&#039;ny taloha ihany, dia ny handehananareo aminy.&quot;', '2023-07-08', 189, '2 Jaona 1:6 ', '2023-06-18', '11:16:07'),
(158, 'Mana : Fiverenana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa efa nania toy ny ondry ianareo , nefa ankehitriny dia efa niverina ho amin&#039;ny Mpiandry sy Mpitandrina ny fanahinareo.&quot;', '2023-07-10', 189, 'I Petera 2 : 25', '2023-06-18', '11:17:35'),
(159, 'Mana : Heloka', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary amin&#039;izany dia lazaiko aminao: Voavela ny helony be, fa be fitiavana izy; fa izay voavela tamin&#039;ny kely dia kely fitiavana.&quot;', '2023-07-11', 189, 'Lioka 7:47', '2023-06-18', '11:20:04'),
(160, 'Mana : Vokatra ny fahendrena', 'FLM AMBOHIDRATRIMO\n\n&quot;Sambatra izay olona mahita fahendrena Sy izay olona mahazo fahalalana.&quot;', '2023-07-12', 189, 'Ohabolana 3:13', '2023-06-18', '11:21:04'),
(161, 'Mana : Fitandremana', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa tandremo ny lal&agrave;na sy ny didy ary ny fitsipika, izay andidiako anao anio, ka araho izy.&quot;', '2023-07-13', 189, 'Deotoronomia 7:11', '2023-06-18', '11:22:12'),
(162, 'Mana : Fanitsiana', 'FLM AMBOHIDRATRIMO\n\n&quot;Anio, raha hihaino ny feony ianareo Aza manamafy ny fonareo.&quot;', '2023-07-14', 189, 'Hebreo 4:7b', '2023-06-18', '11:23:19'),
(163, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Izao no nanehoana ny fitiavan&#039;Andriamanitra antsika: Andriamanitra naniraka ny Zanani-lahy Tokana tamin&#039;izao tontolo izao, mba hahavelona antsika amin&#039;ny alalany. Izao no fitiavana: tsy ny nitiavantsika an&#039;Andriamanitra fa ny nitiavany antsika, ka nirahiny ny Zanany ho avotra&#039;noho ny fahotantsika.&quot;', '2023-07-15', 189, 'I Jaona 4 : 9 - 10', '2023-06-18', '11:24:02'),
(164, 'Mana : Asa ho amin&#039;ny Tompo', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa amin&#039;izany, ry rahalahy malalako, dia miorena tsara, aza miova, ary mahef&agrave; be mandrakariva amin&#039;ny asan&#039;ny Tompo, satria fantatrareo fa tsy foana tsy akory ny fikelezanareo aina ao amin&#039;ny Tompo.&quot;', '2023-07-16', 196, '1 Korintiana 15:58', '2023-06-18', '11:25:28'),
(165, 'Mana : Perikopa', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary hoy koa Izy taminy: Lazaiko aminareo marina dia marina tokoa: Ho hitanareo ny lanitra misokatra sy ny anjelin&#039;Andriamanitra miakatra sy midina eo ambonin&#039;ny Zanak&#039;olona.&quot;', '2023-07-09', 189, 'Jaona 1 : 51', '2023-07-09', '17:32:52'),
(166, 'Mana : Hafatra atao', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa katsaho aloha ny fanjakany sy ny fahamarinany, dia hanampy ho anareo izany rehetra izany. Ary amin&#039;izany dia aza manahy ny amin&#039;ny ampitso ianareo; fa ny ampitso hanahy ny azy.&quot;', '2023-07-07', 189, 'Matio 6 : 33 - 34', '2023-07-09', '17:46:07'),
(167, 'Mana : Fandresena', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa izay rehetra naterak&#039;Andriamanitra dia maharesy izao tontolo izao; ary ny fandresena izay enti-maharesy izao tontolo izao dia ny finoantsika.&quot;', '2023-07-17', 196, 'I Jaona 5 : 4', '2023-07-16', '21:08:50'),
(168, 'Mana : Fifaliana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa amin&#039;ny fifaliana no hivoahanareo, ary amin&#039;ny fiadanana no hitondrana anareo; ny tendrombohitra sy ny havoana hahavelona hoby eo alohanareo, ary ny hazo rehetra any an-tsaha hitehatanana.&quot;', '2023-07-18', 196, 'Isaia 55 : 12', '2023-07-16', '21:10:03'),
(169, 'Mana : Fitsinjovany', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa Izy no mitsinjo hatramin&#039;ny faran&#039;ny tany ary mahatazana manerana izao ambanin&#039; ny lanitra rehetra izao. &quot;', '2023-07-19', 196, 'Joba 28:24', '2023-07-16', '21:10:50'),
(170, 'Mana : Fanekena', 'FLM AMBOHIDRATRIMO\n\n&quot;Ny zavatra rehetra nataon&#039;i Jehovah dia samy misy antony avokoa; Eny, ny ratsy fanahy koa aza dia nataony ho amin&#039;ny andro hahitan-doza.&quot;', '2023-07-20', 196, 'Ohabolana 16 : 4', '2023-07-16', '21:12:07'),
(171, 'Mana : Fahasambarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Jehovah, Tomponay o, endrey ny voninahitry ny anaranao amin&#039;ny tany rehetra! nataonao eny amin&#039;ny lanitra ny voninahitrao.&quot;', '2023-07-21', 196, 'Salamo 8 : 1', '2023-07-16', '21:12:51'),
(172, 'Mana : Lal&agrave;na', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ao amin&#039;i Kristy Jesosy ny lal&agrave;n&#039;ny Fanahin&#039;aina no nahafaka ahy tamin&#039;ny lal&agrave;n&#039;ny fahotana sy ny fahafatesana&quot;', '2023-07-22', 196, 'Romana 8:2', '2023-07-16', '21:13:29'),
(173, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Hoy Jesosy taminy: Satria nahita Ahy ianao, dia nino; sambatra kosa izay tsy nahita, nefa nino&quot;', '2023-07-24', 196, 'Jaona 20:29', '2023-07-16', '21:14:38'),
(174, 'Mana : Fiainana mandrakizay', 'FLM AMBOHIDRATRIMO\n\n&quot;Kanefa aza mifaly ianareo, satria manaiky anareo ny fanahy; fa mifalia, satria voasoratra any an-danitra ny anaranareo&quot;', '2023-07-25', 196, 'Lioka 10 : 20', '2023-07-16', '21:15:42'),
(175, 'Mana : Fitondrana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa Izaho mahalala ny hevitra iheverako anareo, hoy Jehovah, dia hevitra hahatonga fiadanana, fa tsy loza, mba hanome anareo fanantenana ny amin&#039;ny farany&quot;', '2023-07-26', 196, 'Jeremia 29 : 11', '2023-07-16', '21:16:21'),
(176, 'Mana : Fifankatiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mifankatiava araka ny fifankatiavan&#039;ny mpirahalahy; mitariha lalana amin&#039;ny fifanomezam-boninahitra.&quot;', '2023-07-27', 196, 'Romana 12 : 10', '2023-07-16', '21:17:13'),
(177, 'Mana : Fahasambarana', 'FLM AMBOHIDRATRIMO\n\n&quot;Endrey ny hamamin&#039;ny teninao, raha andramako! Mihoatra noho ny tantely ato am-bavako aza!&quot;', '2023-07-28', 196, 'Salamo 119:103', '2023-07-16', '21:17:49'),
(178, 'Mana : Fandinihana teny', 'FLM AMBOHIDRATRIMO\n\n&quot;Fialonana sy fifandirana aza no itorian&#039;ny sasany an&#039;i Kristy, ary fifaliana kosa ny an&#039;ny sasany;&quot;', '2023-07-29', 196, 'Filipiana 1 : 15', '2023-07-16', '21:19:16'),
(179, 'Mana : Fihainona azo', 'FLM AMBOHIDRATRIMO\n\n&quot;Kanefa efa nihaino tokoa Andriamanitra; efa nihaino ny feon&#039;ny fivavako Izy.&quot;', '2023-07-31', 196, 'Salamo 66:19', '2023-07-16', '21:20:22'),
(180, 'Mana : Fitiavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Tsy mbola nisy olona nahita an&#039;Andriamanitra na oviana na oviana. Raha mifankatia isika, dia mitoetra ato amintsika Andriamanitra, ary tanteraka ato amintsika ny fitiavany.&quot;', '2023-08-01', 210, 'I Jaona 4 : 12', '2023-07-30', '17:40:50'),
(181, 'Mana : Ny marina', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa potraka im-pito ny marina, nefa tafarina ihany;&quot;', '2023-08-02', 210, 'Ohabolana 24 : 16b', '2023-07-30', '17:42:10'),
(182, 'Mana : Fahatokiana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ataoko eo anatrehako mandrakariva Jehovah, fa eo an-kavanako Izy, ka dia tsy hangozohozo aho.&quot;', '2023-08-03', 210, 'Salamo 16:8', '2023-07-30', '17:43:01'),
(183, 'Mana : Lesona', 'FLM AMBOHIDRATRIMO\n\n&quot;Tsarovy ny mpitondra anareo, izay efa nitory ny tenin&#039;Andriamanitra taminareo; hevero ny niafaran&#039;ny fiainany, ka araho ny finoany.&quot;', '2023-08-04', 210, 'Hebreo 13 : 7', '2023-07-30', '17:45:27'),
(184, 'Mana : Lalan&#039;i Jehovah', 'FLM AMBOHIDRATRIMO\n\n&quot;Ny lalan&#039;i Jehovah dia fiarovana mafy ho an&#039;izay tsy misy tsiny, Fa fandringanana kosa ho an&#039;ny mpanao ratsy.&quot;', '2023-08-05', 210, 'Ohabolana 10 : 29', '2023-07-30', '20:27:15'),
(185, 'Mana : Toky', 'FLM AMBOHIDRATRIMO\n\n&quot;Indro, Izaho efa hanao zava-baovao, koa ankehitriny dia efa miposaka izany; tsy hahalala izany va ianareo? Eny, any an-efitra no hanaovako lalana ary any amin&#039;ny tany sao no hasiako ony&quot;', '2023-08-07', 217, 'Isaia 43:19', '2023-08-06', '13:06:56'),
(186, 'Mana : Hafatra', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa izay te-hirehareha dia aoka hirehareha amin&#039;izao: Dia ny fahendreny sy ny fahalalany Ahy ho Jehovah, Izay manao famindram-po sy fitsarana marina ary fahamarinana ety ambonin&#039;ny tany; fa izany no sitrako, hoy Jehovah.&quot;', '2023-08-08', 217, 'Jeremia 9 : 23', '2023-08-06', '13:07:49'),
(187, 'Mana : Fisaorana', 'FLM AMBOHIDRATRIMO\n\n&quot;Misaotra an&#039;i Kristy Jesosy Tompontsika aho, Izay nampahery ahy, fa nataony mahatoky aho ka notendreny ho amin&#039;ny fanompoana&quot;', '2023-08-09', 217, '1 Timoty 1:12', '2023-08-06', '13:08:48'),
(188, 'Mana : Jesosy no lalana', 'FLM AMBOHIDRATRIMO\n\n&quot;Hoy Jesoa taminy: Izaho no fananganana ny maty sy fiainana; izay mino Ahy, na dia maty aza, dia ho velona indray.&quot;', '2023-08-10', 217, 'Jaona 11 : 25', '2023-08-06', '13:10:03'),
(189, 'Mana : Fihobiana', 'FLM AMBOHIDRATRIMO\n\n&quot;Jehovah Tomponay &ocirc;, endrey ny voninahitry ny anaranao amin&#039;ny tany rehetra!&quot;', '2023-08-11', 217, 'Salamo 8 : 9', '2023-08-06', '13:10:56'),
(190, 'Mana : Tohin&#039;ny finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Koa dia hitanareo fa hamarinina amin&#039;ny asa ny olona, fa tsy amin&#039;ny finoana ihany.&quot;', '2023-08-12', 217, 'Jakoba 2:24', '2023-08-06', '13:11:37'),
(191, 'Mana : ', 'FLM AMBOHIDRATRIMO\n\n&quot;Jehovah Andriamanitrao no hatahoranao; Izy no hotompoinao, ary Izy no hifikiranao, ary ny anarany no hianiananao.&quot;', '2023-08-14', 224, 'Deoteronomia 10 : 20', '2023-08-13', '20:20:16'),
(192, 'Mana : Fahasoavan&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ny fahasoavan&#039;Andriamanitra no nahatoy izao ahy; ary tsy foana ny fahasoavany ato amiko; fa efa niasa fatratra mihoatra noho izy rehetra aho, nefa tsy izaho, fa ny fahasoavan&#039;Andriamanitra no niara-niasa tamiko.&quot;', '2023-08-15', 225, 'I Korintiana 15 : 10', '2023-08-14', '11:04:25'),
(193, 'Mana : Fivavahana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mivavaha, ka aza mitsahatra.&quot;', '2023-08-16', 225, 'I Tesaloniana 5 : 17', '2023-08-14', '11:05:45'),
(194, 'Mana : Faharetana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ianao kosa dia mahareta amin&#039;izay zavatra nianaranao sy nampinoana anao, satria fantatrao izay nampianatra anao izany.&quot;', '2023-08-17', 225, '2 Timoty 3:14 ', '2023-08-14', '11:15:07'),
(195, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa voasoratra izao, mba hinoanareo fa Jesosy no Kristy, Zanak&#039;Andriamanitra, ary mba hanananareo fiainana amin&#039;ny anarany, raha mino ianareo.&quot;', '2023-08-18', 225, 'Jaona 20:31', '2023-08-14', '11:16:34'),
(196, 'Mana : Fandehanana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa hoy Jehovah tamiko: Aza manao hoe: Mbola zaza aho; fa handeha amin&#039;izay rehetra hanirahako anao ianao, ary izay rehetra handidiako anao no hambaranao.&quot;', '2023-08-19', 225, 'Jeremia 1:7 ', '2023-08-14', '11:18:04'),
(197, 'Mana : Fitariana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa ianao kosa, sy lehilahin&#039;Andriamanitra, mandosira izany zavatra izany, ka miezaha mitady fahamarinana, toe-panahy araka an&#039;Andriamanitra, finoana, fitiavana, faharetana, fahalemem-panahy.&quot;', '2023-08-23', 231, 'I Timoty 6 : 11', '2023-08-14', '11:22:08'),
(198, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary hoy Jesoa taminy: Noho ny fahakelezan&#039;ny finoanareo ihany; fa lazaiko aminareo marina tokoa: Raha manana finoana hoatra ny voan-tsinapy iray aza ianareo ka hiteny amin&#039;io tendrombohitra io hoe: Mifindr&agrave; ery , dia hifindra izy; ary tsy hisy tsy ho hainareo hatao.&quot;', '2023-08-22', 225, 'Matio 17 : 20', '2023-08-14', '11:26:12'),
(199, 'Mana : Fitandremana', 'FLM AMBOHIDRATRIMO\n\n&quot;Tandremo ny fonao mihoatra noho izay rehetra tokony hotandremana; Fa avy ao aminy no ihavian&#039;ny aina.&quot;', '2023-08-21', 231, 'Ohabolana 4:23', '2023-08-20', '19:13:01'),
(200, 'Mana : Fahasoavana', 'FLM AMBOHIDRATRIMO\n\n&quot;Eny tokoa, fahasoavana sy famindram-po no hanaraka ahy amin&#039;ny andro rehetra hiainako, dia hitoetra ao an-tranon&#039;i Jehovah andro lava aho.&quot;', '2023-08-24', 231, 'Salamo 23:6', '2023-08-20', '19:14:39'),
(201, 'Mana : Fankalazana', 'FLM AMBOHIDRATRIMO\n\n&quot;Iza no tsy hatahotra? Ary iza no tsy hankalaza ny anaranao, Tompo &ocirc;? Fa Hianao ihany no masina, ary ny firenena rehetra ho avy hiankohoka eo anatrehanao; Fa efa naharihary ny fitsarana marina nataonao.&quot;', '2023-08-25', 231, 'Apokalypsy 15:4', '2023-08-20', '19:15:57'),
(202, 'Mana : Fahatahorana an&#039;i Jehovah', 'FLM AMBOHIDRATRIMO\n\n&quot;Matahora an&#039;i Jehovah Andriamanitrao ianao, ka manompoa Azy, ary aoka ny anarany no hianiananao.&quot;', '2023-08-26', 231, 'Deoteronomia 6 : 13', '2023-08-20', '19:17:31'),
(203, 'Mana : Isika no fanasina', 'FLM AMBOHIDRATRIMO\n\n&quot;Hianareo no fanasin&#039;ny tany; fa raha ny fanasina no tonga matsatso, inona indray no hahasira azy? Tsy misy heriny hanaovana na inona na inona intsony izy, fa hariana any ivelany ka hohitsahin&#039;ny olona&quot;', '2023-08-28', 233, 'Matio 5:13', '2023-08-22', '16:39:25'),
(204, 'Mana : Fahendrena', 'FLM AMBOHIDRATRIMO\n\n&quot;Anaka, raha taomin&#039;ny mpanota ianao, Aza manaiky&quot;', '2023-08-29', 233, 'Ohabolana 1 : 10', '2023-08-22', '16:40:41'),
(205, 'Mana : Fiderana', 'FLM AMBOHIDRATRIMO\n\n&quot;Lazao amin&#039;Andriamanitra hoe: endrey, mahatahotra ny asanao! ny fahalehibiazan&#039;ny herinao no hikoizan&#039;ny fahavalonao Anao.&quot;', '2023-08-30', 233, 'Salamo 66:3', '2023-08-22', '16:41:36'),
(206, 'Mana : Fanavotana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa Kristy koa aza efa nijaly indray mandeha noho ny ota, ny Marina hamonjy ny tsy marina, mba hitondra antsika ho amin&#039;Andriamanitra, ka novonoina tamin&#039;ny nofo, fa novelomina tamin&#039;ny fanahy&quot;', '2023-08-31', 233, 'I Petera 3 : 18', '2023-08-22', '16:48:04'),
(207, 'Mana : Fanaiana', 'FLM AMBOHIDRATRIMO\n\n&quot;Mahereza sy matanjaha; aza matahotra na manahy azy; fa Jehovah Andriamanitrao no miara-mandeha aminao; tsy handao anao na hahafoy anao Izy&quot;', '2023-09-01', 241, 'Deotoronomia 31:6', '2023-08-30', '18:12:52'),
(208, 'Mana : Tenin&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa tsy hisy tsy ho tanteraka ny teny rehetra ataon&#039;Andriamanitra.&quot;', '2023-09-02', 243, 'Lioka 1:37', '2023-09-01', '20:25:26'),
(209, 'Mana : anatra fahatanoranao', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary tsarovy ny Mpanao anao amin&#039;ny andro fahatanoranao, dieny tsy mbola tonga ny andro mahory, ary tsy mbola mihatra ny taona izay hanaovanao hoe; Tsy sitrako izao.&quot;', '2023-09-04', 243, 'Mpitoriteny 12:1', '2023-09-01', '20:26:36'),
(210, 'Mana : Fahatsiarovan-tena', 'FLM AMBOHIDRATRIMO\n\n&quot;Ry kely saina, mandra-pahoviana no hitiavanareo ny fahadalana, Sy hifalian&#039;ny mpaniratsira amin&#039;ny faniratsirana, Ary hankahalan&#039;ny adala ny fahalalana?&quot;', '2023-09-05', 243, 'Ohabolana 1 : 22', '2023-09-01', '20:27:36'),
(211, 'Mana : Finoana', 'FLM AMBOHIDRATRIMO\n\n&quot;Sambatra ianareo, raha haratsina noho ny anaran&#039;i Kristy, fa ny Fanahin&#039;ny voninahitra, dia ny Fanahin&#039;Andriamanitra, mipetraka ao aminareo.&quot;', '2023-09-06', 243, '1 Petera 4:14', '2023-09-01', '20:28:30'),
(212, 'Mana : Fifaliana', 'FLM AMBOHIDRATRIMO\n\n&quot;Eny, ry rahalahy, aoka hanana fifaliana avy aminao ao amin&#039;ny Tompo aho; velombelomy ny foko ao amin&#039;i Kristy.&quot;', '2023-09-07', 243, 'Filemona 1:20', '2023-09-01', '20:29:16'),
(213, 'Mana : Jesosy no mpanafaka', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary mba hiandry ny Zanany avy any an-danitra, Izay natsangany tamin&#039;ny maty, dia Jesosy, izay Mpanafaka antsika amin&#039;ny fahatezerana ho avy&quot;', '2023-09-08', 243, '1 Tesaloniana 1:10', '2023-09-01', '20:31:22'),
(214, 'Mana : Jesosy no mpanalalana', 'FLM AMBOHIDRATRIMO\n\n&quot;Fa iray no Andriamanitra, ary iray no Mpanalalana amin&#039; Andriamanitra sy ny olona, dia Kristy Jesosy, Izay olona.&quot;', '2023-09-09', 243, '1 Timoty 2:5', '2023-09-01', '20:32:13'),
(215, 'Mana : Fiarahana amin&#039;Andriamanitra', 'FLM AMBOHIDRATRIMO\n\n&quot;Mifalia, aoka ho tanteraka ianareo, mandraisa ny fampiononana, miraisa saina, mihav&agrave;na; ary Andriamanitry ny fitiavana sy ny fiadanana ho aminareo.&quot;', '2023-09-11', 243, '2 Korintiana 13:11', '2023-09-01', '20:33:41'),
(216, 'Mana : Fiaretana', 'FLM AMBOHIDRATRIMO\n\n&quot;Dia hoy Jesosy tamin&#039;ny Jiosy izay nino Azy: Raha maharitra amin&#039;ny teniko ianareo, dia ho mpianatro tokoa; ka ho fantatrareo ny marina, ary ny marina hahafaka anareo tsy ho andevo.&quot;', '2023-09-12', 243, 'Jaona 8 : 31-32', '2023-09-01', '20:36:46'),
(217, 'Mana : Ny heloka', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary, indro, nisy lehilahy anankiray mararin&#039;ny paralysisa nandry tamin&#039;ny fandriana nentin&#039;ny olona teo aminy; ary Jesosy, nony nahita ny finoan&#039;ireo, dia nanao tamin&#039;ilay mararin&#039;ny paralysisa hoe: Matokia, anaka; voavela ny helokao.&quot;', '2023-09-13', 243, 'Matio 9 : 2', '2023-09-01', '20:38:33'),
(218, 'Mana : Vokatra ratsy', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary ny fahatezerana sy ny fahavinirana no hamaliako ny firenena izay tsy mihaino.&quot;', '2023-09-14', 243, 'Mika 5 : 14', '2023-09-01', '20:39:23'),
(219, 'Mana : Fananarana ', 'FLM AMBOHIDRATRIMO\n\n&quot;Izay tia fananarana no tia fahalalana; Fa izay dia mand&agrave; dia biby. Ny tsara fanahy mahazo sitraka amin&#039;i Jehovah; Fa ny mamoron-tsain-dratsy hohelohiny.&quot;', '2023-09-15', 243, 'Ohabolana 12 : 1-2', '2023-09-01', '20:40:19'),
(220, 'Mana : Famindr&agrave;na fo', 'FLM AMBOHIDRATRIMO\n\n&quot;Mamindr&agrave; fo amiko, Jehovah &ocirc;; mitsinjova ny fahoriako avy amin&#039;izay mankahala ahy, Ry Mpanandratra ahy ho afaka amin&#039;ny vavahadin&#039;ny fahafatesana.&quot;', '2023-09-18', 259, 'Salamo 9:13', '2023-09-01', '20:42:43'),
(221, 'Mana : Jesosy miteny', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary rehefa nilaza izany Izy, dia nanisy fofonaina, ka hoy Izy taminy; Raiso ny Fanahy Masina.&quot;', '2023-09-19', 259, 'Jaona 20:22', '2023-09-17', '18:44:32'),
(222, 'Mana : Tsy ny mofo ihany', 'FLM AMBOHIDRATRIMO\n\n&quot;Ary Jesosy nahalala izany dia nanao hoe: Nahoana ianareo, ry kely finoana, no miara-misaina satria \ntsy manana mofo? Tsy mbola mahafantatra va ianareo\nary tsy tsaroanareo va ny mofo dimy ho an&#039;ny dimy arivo ka firy harona moa no nangoninareo?&quot;', '2023-09-20', 259, 'Matio 16 : 8 - 9', '2023-09-17', '19:10:21'),
(223, 'Mana : Didy voalohany', 'FLM AMBOHIDRATRIMO\n\n&quot;Izaho no Jehovah Andriamanitrao, Izay nitondra anao nivoaka avy tany amin&#039;ny tany Egypta, tamin&#039;ny trano nahandevozana. Aza manana andriamani-kafa, fa Izaho ihany.&quot;', '2023-09-21', 262, 'Eksodosy 20 : 2 - 3', '2023-09-20', '07:10:11'),
(224, 'Mana :Didy voalohany (tohiny)', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza manao sarin-javatra voasokitra ho anao, na ny mety ho endriky ny zavatra izay eny amin&#039;ny lanitra ambony, na izay ety amin&#039;ny tany ambany, na izay any amin&#039;ny rano ambanin&#039;ny tany. Aza miankohoka eo anatrehany, ary aza manompo azy; fa Izaho, Jehovah Andriamanitrao, dia Andriamanitra saro-piaro ka mamaly ny heloky ny ray amin&#039;ny zanaka hatramin&#039;ny zafiafy sy ny zafindohalika, dia amin&#039;izay mankahala Ahy; nefa kosa mamindra fo amin&#039;ny olona arivo mandimby izay tia Ahy ka mitandrina ny didiko.&quot;', '2023-09-22', 262, 'Eksodosy 20 : 4 - 6', '2023-09-20', '07:10:39'),
(225, 'Mana : Didy faharoa', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza manonona foana ny anaran&#039;i Jehovah Andriamanitrao; fa tsy hataon&#039;i Jehovah ho tsy manan-tsiny izay manonona foana ny anarany.&quot;', '2023-09-23', 262, 'Eksodosy 20 : 7', '2023-09-20', '07:11:08'),
(226, 'Mana : Didy fahatelo', 'FLM AMBOHIDRATRIMO\n\n&quot;Mahatsiarova ny andro Sabata hanamasina azy. Henemana no hiasanao sy hanaovanao ny raharahanao rehetra. Fa Sabatan&#039;i Jehovah Andriamanitrao ny andro fahafito; koa aza manao raharaha akory ianao amin&#039;izany, na ny zanakao-lahy, na ny zanakao-vavy, na ny ankizilahinao, na ny ankizivavinao na ny biby fiompinao, na ny vahininao izay tafiditra eo am-bavahadinao. Fa henemana no nanaovan&#039;i Jehovah ny lanitra sy ny tany sy ny ranomasina mbamin&#039;izay rehetra ao aminy, dia nitsahatra Izy tamin&#039;ny andro fahafito; izany no nitahian&#039;i Jehovah ny andro Sabata sy nanamasinany azy.&quot;', '2023-09-24', 262, 'Eksodosy 20 : 8 - 11', '2023-09-20', '07:12:03'),
(227, 'Mana : Didy fahefatra', 'FLM AMBOHIDRATRIMO\n\n&quot;Manaj&agrave; ny rainao sy ny reninao mba ho maro andro ianao ao amin&#039;ny tany izay omen&#039;i Jehovah Andriamanitrao ho anao.&quot;', '2023-09-25', 262, 'Eksodosy 20 : 12', '2023-09-20', '07:14:20'),
(228, 'Mana : Didy fahadimy', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza mamono olona.&quot;', '2023-09-26', 262, 'Eksodosy 20 : 13', '2023-09-20', '07:17:59'),
(229, 'Mana : Didy fahenina', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza mijangajanga.&quot;', '2023-09-27', 262, 'Eksodosy 20 : 14', '2023-09-20', '07:18:34'),
(230, 'Mana : Didy fahafito', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza mangalatra.&quot;', '2023-09-28', 262, 'Eksodosy 20 : 15', '2023-09-20', '07:19:19'),
(231, 'Mana : Didy fahasivy', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza mety ho vavolombelona mandainga hanameloka ny namanao.&quot;', '2023-09-29', 262, 'Eksodosy 20 : 16', '2023-09-20', '07:20:05'),
(232, 'Mana : Didy fahafolo', 'FLM AMBOHIDRATRIMO\n\n&quot;Aza mitsiriritra ny tranon&#039;ny namanao; aza mitsiriritra ny vadin&#039;ny namanao, na ny ankizilahiny, na ny ankizivaviny, na ny ombiny, na ny borikiny, na izay mety ho an&#039;ny namanao akory aza.&quot;', '2023-09-30', 262, 'Eksodosy 20 : 17', '2023-09-20', '07:20:39'),
(233, 'Raharaha : ISANDROAVOLANA  - FLM AMBODIHADY', 'FLM AMBOHIDRATRIMO\n\n&quot;... Hitsangana ny anadahinao.&quot;\nJaona 11 : 23\n\nISANDROAVOLANA - FLM AMBODIHADY\nZoma 22 Septambra 2023\n\nFIOFANANA TAFIKA MASINA SY TAFIKA MASINA\n\n- Maraina : 08ora - 9ora\n&quot;... Izay ahazoan&#039;ny fianakaviana rehetra any an-danitra sy ety an-tany anarana ...&quot; (Efesiana 3 : 13-21) Past RAKOTOMALALA\n\n- Tafika Masina : 09ora - 12ora sy 02ora - 05ora hariva\n', '2023-09-21', 262, ' ', '2023-09-20', '08:02:14'),
(234, 'Raharaha : ISANDROAVOLANA - FLM AMBODIHADY', 'FLM AMBOHIDRATRIMO\n\n&quot;... Hitsangana ny anadahinao.&quot;\nJaona 11 : 23\n\nISANDROAVOLANA - FLM AMBODIHADY\nAsabotsy 23 Septambra 2023\n\n- ISANDROAVOLANAN&#039;NY VLM - FD - FIFIL FITANDREMANA\nMaraina : 09ora - 12ora sy sasany\n\n- ISANDROAVOLANAN&#039;NY  FBL - FDL - SKOTO - KTLM FITANDREMANA\nTolakandro : 02ora - 05ora', '2023-09-22', 262, ' ', '2023-09-20', '08:06:01'),
(235, 'Raharaha : ISANDROAVOLANA - FLM AMBODIHADY', 'FLM AMBOHIDRATRIMO\n\n&quot;... Hitsangana ny anadahinao.&quot;\nJaona 11 : 23\n\nISANDROAVOLANA - FLM AMBODIHADY\nAlahady 24 Septambra 2023\n\n- ISANDROAVOLANAN&#039;NY SALOMA FITANDREMANA\nMaraina : 07ora sy sasany - 09ora\n- ISANDROAVOLANA RENINY\nMaraina : 09ora sy sasany - 12ora\n- ANTSAM-PANAHIN&#039;NY ISANDROAVOLANA\nTolakandro : 02ora - 05ora', '2023-09-23', 262, ' ', '2023-09-20', '08:11:43');
